# Definition for singly-linked list.class ListNode:     def __init__(self, x):         self.val = x         self.next = Noneclass Solution:    def deleteDuplicates(self, head):        """        :type head: ListNode        :rtype: ListNode        """        cur=head        dict={}        ans=[]        while cur:            if cur.val not in dict:                dict[cur.val]=1            elif cur.val not in ans:                ans.append(cur.val)            cur=cur.next        cur=ListNode(-1)        res=cur        cur.next=head        while cur.next:            if cur.next.val in ans:                cur.next=cur.next.next            else:                cur=cur.next        return res.nextobj = Solution()head=ListNode(1)head.next=ListNode(2)head.next.next=ListNode(3)head.next.next.next=ListNode(3)head.next.next.next.next=ListNode(5)obj.deleteDuplicates(head)